INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(1, 'A', 'Salah satu pihak berbuat zina atau menjadi pemabuk, pemadat, penjudi, dan lain sebagainya yang sukar disembuhkan.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(2, 'B', 'Salah satu pihak meninggalkan yang lain selama dua tahun berturut-turut tanpa izin pihak yang lain dan tanpa alasan-alasan yang sah atau karena hal lain diluar kemauannya. ');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(3, 'C', 'Salah satu pihak mendapat hukuman penjara lima tahun atau hukuman yang lebih berat setelah perkawinan berlangsung.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(4, 'D', 'Salah satu pihak melakukan kekejaman atau penganiayaan berat yang membahayakan pihak lain.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(5, 'E', 'Salah satu pihak mendapat cacat badan atau penyakit dengan akibat tidak dapat menjalankan kewajibannya sebagai suami atau isteri.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(6, 'F', 'Antara suami dan isteri terus menerus terjadi perselisihan dan pertengkaran dan tidak ada harapan akan hidup rukun lagi dalam rumah tangga.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(7, 'G', 'Suami melanggar taklik talak.');
INSERT INTO `tbl_alasan` (`id_alasan`, `kd_alasan`, `detail_alasan`) VALUES
	(8, 'H', 'Peralihan agama atau murtad yang menyebabkan terjadinya ketidak rukunan dalam rumah tangga.');
